import React, { useState } from 'react';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import Icon from '@material-ui/core/Icon';
import Messaging from './components/messaging';
import Profile from './components/profile';


export default function messenger() {
  const [value, setValue] = React.useState('profile');
  function LabelBottomNavigation() {


    function handleChange(event, newValue) {
      setValue(newValue);
    }
    function handlePages() {
      if (value === 'profile') {
        return <Profile />
      } else if (value === 'wallet') {
        return <span>Favorites</span>
      } else if (value === 'nearby') {
        return <span>Nearby</span>
      } else if (value === 'messenger') {
        return <Messaging />
      }
    }
    return (
      <div>
        {handlePages()}
        <BottomNavigation value={value} onChange={handleChange} page={value}>
          <BottomNavigationAction label="Profile" value="profile" icon={<Icon><img src="./icons/icons_identity.png" className="icon-image" alt="ðŸ˜€" /></Icon>} />
          <BottomNavigationAction label="Wallet" value="wallet" icon={<Icon><img src="./icons/icons_wallet.png" className="icon-image" alt="ðŸ’°" /></Icon>} />
          <BottomNavigationAction label="Posts" value="posts" icon={<Icon><img src="./icons/icons_globe.png" className="icon-image" alt="ðŸ“£" /> </Icon>} />
          <BottomNavigationAction label="Messenger" value="messenger" icon={<Icon><img src="./icons/icons_partners.png" className="icon-image" alt="ðŸ“œ" /></Icon>} />
        </BottomNavigation>
      </div>
    );
  }
  return (
    <div className="App">
      {LabelBottomNavigation()}
    </div>
  )
}
